    # --- НОВАЯ ФУНКЦИЯ ---
    def run_scaling_check(self):
        """ Отдельная функция для вызова проверки, чтобы не блокировать __init__ """
        is_scaled, scale_percent = self.check_windows_scaling()
        if is_scaled:
            self.show_scaling_warning(scale_percent)

    # --- НОВАЯ ФУНКЦИЯ ---
    def check_windows_scaling(self):
        """
        Проверяет, включено ли масштабирование в Windows (>100%),
        используя WinAPI для надежности.
        Возвращает кортеж: (True/False, процент масштабирования).
        """
        try:
            STANDARD_DPI = 96
            dc = ctypes.windll.user32.GetDC(0)
            # 88 - это константа LOGPIXELSX (DPI по горизонтали)
            current_dpi = ctypes.windll.gdi32.GetDeviceCaps(dc, 88)
            ctypes.windll.user32.ReleaseDC(0, dc)

            if current_dpi > STANDARD_DPI:
                scale_percent = round((current_dpi / STANDARD_DPI) * 100)
                return True, scale_percent
            else:
                return False, 100
        except Exception as e:
            # Резервный метод через tkinter, если WinAPI не сработал
            print(f"Не удалось определить DPI через ctypes: {e}")
            try:
                current_dpi_tk = self.root.winfo_fpixels('1i')
                if current_dpi_tk > 96:
                    scale_percent = round((current_dpi_tk / 96.0) * 100)
                    return True, scale_percent
            except Exception:
                pass
            return False, 100

